package net.geekscore.string;

import java.util.Arrays;
import java.util.Collections;
import java.util.LinkedList;
import java.util.List;
import java.util.stream.Collectors;
import java.util.stream.IntStream;

/**
 * SLIDING WINDOW
 *
 * Given a string s and a non-empty string p, find all the start indices of p's anagrams in s.
 *
 * Strings consists of lowercase English letters only and the length of both string s and p will not be larger than 20,100.
 *
 * The order of output does not matter.
 *
 * Example 1:
 * Input:
 * s: "cbaebabacd" p: "abc"
 * Output:
 * [0, 6]
 *
 * Explanation:
 * The substring with start index = 0 is "cba", which is an anagram of "abc".
 * The substring with start index = 6 is "bac", which is an anagram of "abc".
 *
 * Example 2:
 * Input:
 * s: "abab" p: "ab"
 * Output:
 * [0, 1, 2]
 *
 * Explanation:
 * The substring with start index = 0 is "ab", which is an anagram of "ab".
 * The substring with start index = 1 is "ba", which is an anagram of "ab".
 * The substring with start index = 2 is "ab", which is an anagram of "ab".
 *
 **/

public class FindAllAnagramsInString {

    public static void main(String[] args) {
        System.out.println(findAnagrams("efgcbaebabacd", "abc")); //[3, 9]
        System.out.println(findAnagrams("cbaebabacd", "abc")); //[0, 6]
        System.out.println(findAnagrams("abab", "ab")); //[0, 1, 2]
        System.out.println(findAnagrams("ababab", "ba")); //[0, 1, 2, 3, 4]
        System.out.println(findAnagrams("ab", "ba")); //[0]
        System.out.println(findAnagrams("a", "ba")); //[]
        System.out.println(findAnagrams("ab", "")); //[0,1,2]
        System.out.println(findAnagrams("ab", "abc")); //[]
        System.out.println(findAnagrams(
                "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa" +
                        "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa" +
                        "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa" +
                        "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa" +
                        "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa" +
                        "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa" +
                        ""
                , "")); //[]

        System.out.println("--------------------");
        System.out.println(findAnagramsEfficient("efgcbaebabacd", "abc")); //[3, 9]
        System.out.println(findAnagramsEfficient("cbaebabacd", "abc")); //[0, 6]
        System.out.println(findAnagramsEfficient("abab", "ab")); //[0, 1, 2]
        System.out.println(findAnagramsEfficient("ababab", "ba")); //[0, 1, 2, 3, 4]
        System.out.println(findAnagramsEfficient("ab", "ba")); //[0]
        System.out.println(findAnagramsEfficient("a", "ba")); //[]
        System.out.println(findAnagramsEfficient("ab", "")); //[0,1,2]
        System.out.println(findAnagramsEfficient("ab", "abc")); //[]
        System.out.println(findAnagramsEfficient(
                "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa" +
                        "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa" +
                        "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa" +
                        "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa" +
                        "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa" +
                        "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa" +
                        ""
                , "")); //[]

        System.out.println("--------------------");
        System.out.println(findAnagramsEfficient1("efgcbaebabacd", "abc")); //[3, 9]
        System.out.println(findAnagramsEfficient1("cbaebabacd", "abc")); //[0, 6]
        System.out.println(findAnagramsEfficient1("abab", "ab")); //[0, 1, 2]
        System.out.println(findAnagramsEfficient1("ababab", "ba")); //[0, 1, 2, 3, 4]
        System.out.println(findAnagramsEfficient1("ab", "ba")); //[0]
        System.out.println(findAnagramsEfficient1("a", "ba")); //[]
        System.out.println(findAnagramsEfficient1("ab", "")); //[0,1,2]
        System.out.println(findAnagramsEfficient1("ab", "abc")); //[]
        System.out.println(findAnagramsEfficient1(
                "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa" +
                        "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa" +
                        "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa" +
                        "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa" +
                        "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa" +
                        "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa" +
                        ""
                , "")); //[]
    }

    private static final List<Integer> findAnagrams(String s, String p) {

        if(s == null || p == null || s.length() < p.length()) {
            return Collections.EMPTY_LIST;
        }
        final List<Integer> anagramIndices = new LinkedList<>();
        final char[] pChars = p.toLowerCase().toCharArray();
        Arrays.sort(pChars);
        final String pStr = new String(pChars);

        final int lengthP = p.length();
        for (int i = 0; i <= s.length() - lengthP; i++) {
            final String strOfLengthP = s.substring(i, i+lengthP).toLowerCase();
            final char[] strOfLengthPChars = strOfLengthP.toCharArray();
            Arrays.sort(strOfLengthPChars);
            final String strOfLengthPCharsSorted = new String(strOfLengthPChars);
            if(pStr.equalsIgnoreCase(strOfLengthPCharsSorted)) {
                anagramIndices.add(i);
            }
        }
        return anagramIndices;
    }

    private static final List<Integer> findAnagramsEfficient(String s, String p) {

        if(s == null || p == null || s.length() < p.length()) {
            return Collections.EMPTY_LIST;
        }
        if(p.length() == 0){
            return IntStream.rangeClosed(0, s.length()).boxed().collect(Collectors.toList());
        }
        final List<Integer> anagramIndices = new LinkedList<>();
        final int[] freq = new int[256];
        for (final char pChar : p.toCharArray()) {
            freq[pChar]++;
        }
        int left = 0, right = left, counter = p.length();
        while (right < s.length()) {
            if(freq[s.charAt(right++)]-- > 0) {
                // char present in s also present in p will have values > 0 in freq for first time, then 0 or more
                // for chars that are present in s but not in t will have values < 0
                counter--;
            }
            if(counter == 0) {
                anagramIndices.add(left);
            }
            if(right - left == p.length()) {
                if(freq[s.charAt(left++)]++ >= 0) {
                    counter++;
                }
            }
        }
        return anagramIndices;
    }

    private static final List<Integer> findAnagramsEfficient1(String s, String p) {

        if(s == null || p == null || s.length() < p.length()) {
            return Collections.EMPTY_LIST;
        }
        if(p.length() == 0){
            return IntStream.rangeClosed(0, s.length()).boxed().collect(Collectors.toList());
        }
        final List<Integer> anagramIndices = new LinkedList<>();
        final int[] freqs = new int[26];
        s = s.toUpperCase();
        p = p.toUpperCase();
        for (final char pChar : p.toCharArray()) {
            freqs[pChar - 'A']++;
        }
        for (int l = 0, r = 0, cnt = 0; r < s.length(); r++) {      // sliding window checks
            if (r - l == p.length() && ++freqs[s.charAt(l++) - 'A'] > 0) { cnt--; }
            if (freqs[s.charAt(r) - 'A']-- > 0 && ++cnt == p.length()) { anagramIndices.add(l); }
        }

        return anagramIndices;
    }
}
